    this.app.COD_SERVICIO_GBL = this.app.COD_SERV_GBL;
    NUMFAM = this.app.SSN_GBL;
    FECHA = this.app.SYSTEM_DATE;
    CLIENTES2_RO_DSD = this.dm.create ( "CLIENTES2_RO_DSD" );
    OPENID = CLIENTES2_RO_DSD.getId ( );
    STATUSID = RallyDataStoreException.getDefault ( );
    if ( ! Compare.equals ( STATUSID, 0 ) ) 
    {
    }

    STATUSID  = this.dm.reset ( OPENID );

    if ( ! Compare.equals ( STATUSID, 0 ) ) 
    {
    }
    SERVICIOS2_DSD = this.dm.create ( "SERVICIOS2_DSD" );
    SERV_ID = SERVICIOS2_DSD.getId ( );
    SERV_STATUS = RallyDataStoreException.getDefault ( );
    if ( ! Compare.equals ( SERV_STATUS, 0 ) ) 
    {
    }

    SERV_STATUS  = this.dm.reset ( SERV_ID );

    if ( ! Compare.equals ( SERV_STATUS, 0 ) ) 
    {
    }
    this.dm.setField ( this.dm.get ( "CLIENTES2_RO_DSD" ), "SEGURO_SOCIAL_CLIENTE", SS_NUM_REF );
    this.dm.setField ( this.dm.get ( "CLIENTES2_RO_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );

    STATUSID  = this.dm.limitQueryFromBuffer ( OPENID );
    STATUSID  = this.dm.retrieve ( OPENID );

    if ( ! Compare.equals ( STATUSID, 0 ) ) 
    {
      this.app.setError ( 0, STATUSID );
      this.doReturn ( );
      return; 
    }

    STATUSID  = this.dm.firstRow ( OPENID );

    if ( ! Compare.equals ( STATUSID, 0 ) ) 
    {
      this.app.setError ( 1, STATUSID );
      this.doReturn ( );
      return; 
    }
    if ( ! Compare.equals ( this.dm.getFieldDouble ( this.dm.get ( "CLIENTES2_RO_DSD" ), "SEGURO_SOCIAL_JEFE_FAMILIA" ), this.app.SS_JEFE_GBL ) ) 
    {
      this.app.setError ( 2, 6509 );
      this.doReturn ( );
      return; 
    }
    NOMBREREF = this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_NOMBRE" ) + " " + this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_INICIAL" ) + " " + this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_APELLIDO_PATERNO" ) + " " + this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_APELLIDO_MATERNO" );

    STATUSID  = this.dm.reset ( OPENID );

    if ( ! Compare.equals ( STATUSID, 0 ) ) 
    {
    }
    this.dm.setField ( this.dm.get ( "CLIENTES2_RO_DSD" ), "SEGURO_SOCIAL_CLIENTE", this.app.SSN_GBL );
    this.dm.setField ( this.dm.get ( "CLIENTES2_RO_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );

    STATUSID  = this.dm.limitQueryFromBuffer ( OPENID );
    STATUSID  = this.dm.retrieve ( OPENID );

    if ( ! Compare.equals ( STATUSID, 0 ) ) 
    {
      this.app.setError ( 3, STATUSID );
      this.doReturn ( );
      return; 
    }

    STATUSID  = this.dm.firstRow ( OPENID );

    if ( ! Compare.equals ( STATUSID, 0 ) ) 
    {
      this.app.setError ( 4, STATUSID );
      this.doReturn ( );
      return; 
    }
    if ( Compare.gt ( this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "COD_PSM" ), "" ) ) 
    {
      SI2 = "X";
    }
    else
    {
      NO2 = "X";
    }
    FECHA3 = this.dm.getFieldDate ( this.dm.get ( "CLIENTES2_RO_DSD" ), "FCH_FIRMO_PRI" );
    FECHA4 = this.dm.getFieldDate ( this.dm.get ( "CLIENTES2_RO_DSD" ), "FCH_ENTREGA_AUTOGESTION" );
    TELEFONO = this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "TELEFONO_HOGAR" );
    FECHA5 = this.dm.getFieldDate ( this.dm.get ( "CLIENTES2_RO_DSD" ), "FCH_ENTREGA_AUTOGESTION" );

    this.callParms.clear ( );
    this.callParms.set ( this.dm.getFieldDouble ( this.dm.get ( "CLIENTES2_RO_DSD" ), "RMO_OFICINA" )  );
    this.callParms.set ( REGION  );
    this.callParms.set ( MUNI  );
